import classes from './Header.module.css'
import logo from '../../images/logo.png'

const Header = () => {
    return (
        <header className={classes.header}>   
            <div>
                <span className={classes.heading}>Motus</span> <img className={classes.logo} src={logo} alt="" /> <span className={classes.heading}>Osteopathy</span>
            </div> 
        </header>
    )
}

export default Header
